import React, { } from 'react';
import style from './SettingPage.module.css'
import Account from './Tabs/Account'
import Profile from './Tabs/Profile'
import FeedSettings from './Tabs/FeedSettings'
import SafetyPrivacy from './Tabs/Safety&Privacy';
import Notifications from './Tabs/Notifications';
import Emails from './Tabs/Emails';
import Subscription from './Tabs/Subscription';
import ChatsMessaging from './Tabs/Chats&Messaging';
import classes from './Tabs/Account.module.css'

export default function Settings() {
    const [value,setValue] = React.useState(0)
    const [Acctab, setAcctab] = React.useState(true)
    const [Profiletab, setProfiletab] = React.useState(true)
    const [Safetytab, setSafetytab] = React.useState(true)
    const [Feedtab, setFeedtab] = React.useState(true)
    const [Notifitab, setNotifitab] = React.useState(true)
    const [Emailstab, setEmailstab] = React.useState(true)
    const [Subtab, setSubtab] = React.useState(true)
    const [Chatstab, setToggle] = React.useState(true)
    const actArray = []
    for(let i=0;i<8;i++){
        if (i===value){
        actArray.push(`${style.btn} ${style.active}`)
        }
        else{
        actArray.push(`${style.btn}`)
        }
    }
    return(
        <div className='container'>
            <h3 className={`${style.SettingHeader}`}>User settings</h3>
            <div className="container" >
                <a className={`${style.li}`} ><button type='button' className={actArray[0]} onClick={() => setToggle(!Acctab) , setValue(0)}>Account</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[1]} onClick={() => setToggle(!Profiletab), setValue(1)}>Profile</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[2]} onClick={() => setToggle(!Safetytab), setValue(2)}>Safety & Privacy</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[3]} onClick={() => setToggle(!Feedtab), setValue(3)}>Feed Settings</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[4]} onClick={() => setToggle(!Notifitab), setValue(4)}>Notifications</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[5]} onClick={() => setToggle(!Emailstab), setValue(5)}>Emails</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[6]} onClick={() => setToggle(!Subtab), setValue(6)}>Subscriptions</button></a>
                <a className={`${style.li}`} ><button type='button' className={actArray[7]} onClick={() => setToggle(!Chatstab), setValue(7) }>Chat & Messaging</button></a>
            </div>
            <hr className='m-0'></hr>
            {Acctab &&
            (<Account />)}
            {Profiletab && (<Profile />)}
             {/* <div className={tabArray[1]}>
             <Profile />
             </div>
             <div className={tabArray[2]}>
             <SafetyPrivacy />
             </div>
             <div className={tabArray[3]}>
             <FeedSettings />
             </div>
             <div className={tabArray[4]}>
             <Notifications />
             </div>
             <div className={tabArray[5]}>
             <Emails />
             </div>
             <div className={tabArray[6]}>
             <Subscription />
             </div>
             <div className={tabArray[7]}>
             <ChatsMessaging />
             </div> */}

        </div>
    )
}
